array[0] += 137 * 1400;
var boxSize = 100;
var rel_size = 100;

function resize(){
  var size = Math.min(window.innerHeight - 20, (window.innerWidth - 30) / 2);
  rel_size = size / 14;
  canvas1.style.width = size + "px";
  canvas1.style.height = size + "px";
  canvas2.style.width = size + "px";
  canvas2.style.height = size + "px";
  canvas2.style.left = (size + 20) + "px";
}
resize();

var isBlack = false;
var imageData = ctx1.getImageData(0, 0, 1400, 1400);
var newimageData = [];
for (var i = 0; i < array.length; i++){
  if (isBlack){
    for (var j = 0; j < array[i]; j++) newimageData.push(0, 0, 0, 255);
  } else {
    for (var j = 0; j < array[i]; j++) newimageData.push(252, 201, 22, 255); // 252 201 22
  }
  isBlack = !isBlack;
}
for (var i = 0; i < newimageData.length; ++i) imageData.data[i] = newimageData[i];
ctx1.putImageData(imageData, 0, 0);

function render_ctx2(xi, yi){
  var data = ctx1.getImageData(xi * boxSize - 10, yi * boxSize - 10, boxSize + 20, boxSize + 20).data;
  ctx2.fillStyle = "rgb(252, 201, 22)";
  ctx2.fillRect(0, 0, 480, 480);
  ctx2.fillStyle = "black";
  for (var x = 0; x < 120; ++x){
    for (var y = 0; y < 120; ++y){
      if (data[4 * (y * 120 + x)] == 0) ctx2.fillRect(4*x, 4*y, 4, 4);
    }
  }
  ctx2.beginPath();
  ctx2.strokeStyle = "red";
  ctx2.lineWidth = 2;
  ctx2.rect(39, 39, 402, 402);
  ctx2.stroke();
}

var cur_x = 0, cur_y = 0;
document.onclick = function (e){
  var xi = Math.floor((e.pageX - 10) / rel_size);
  var yi = Math.floor((e.pageY - 10) / rel_size);
  cur_x = xi;
  cur_y = yi;
  if (xi >= 0 && xi < 14 && yi >= 0 && yi < 14){
    document.getElementById("square").style.width = rel_size + "px";
    document.getElementById("square").style.height = rel_size + "px";
    document.getElementById("square").style.left = (xi * rel_size + 10) + "px";
    document.getElementById("square").style.top = (yi * rel_size + 10) + "px";
    render_ctx2(xi, yi);
  }
}
document.onkeydown = function (e){
  var dx = 0, dy = 0;
  if (e.key == "ArrowUp") dy = -1;
  if (e.key == "ArrowDown") dy = 1;
  if (e.key == "ArrowLeft") dx = -1;
  if (e.key == "ArrowRight") dx = 1;
  var new_x = Math.max(Math.min(cur_x + dx, 13), 0);
  var new_y = Math.max(Math.min(cur_y + dy, 13), 0);
  if (new_x != cur_x || new_y != cur_y){
    cur_x = new_x;
    cur_y = new_y;
    document.getElementById("square").style.width = rel_size + "px";
    document.getElementById("square").style.height = rel_size + "px";
    document.getElementById("square").style.left = (cur_x * rel_size + 10) + "px";
    document.getElementById("square").style.top = (cur_y * rel_size + 10) + "px";
    render_ctx2(cur_x, cur_y);
  }
}
